function App(){
  const menu = ['Watches', 'Bags & Luggage', 'Sunglasses',
                'Jewellery', 'Wallets']
  return(
    <div>
     <h1>Accessories</h1>
      {menu.map((access)=>(
        <p>{access}</p>
      ))}
    </div>
  )
}

export default App;
